import { createMuiTheme } from '@material-ui/core/styles';

const dfBrown100 = '#d2691e';
const dfBrown75 = 'Chocolate';
const dfBrown50 = '#d2691e80';
// const dfBrown25 = '#d2691e42';

const dfYellow100 = '#c99e03';
const dfYellow75 = '#c99e03bf';
const dfYellow50 = '#c99e0380';
// const dfYellow25 = '#c99e0342';

export default createMuiTheme({
  palette: {
    common: {
      brownDark: `${dfBrown100}`,
      brownLight: `${dfBrown50}`,
      yellowDark: `${dfYellow100}`,
      yellowLight: `${dfYellow50}`,
    },
    primary: {
      main: `${dfBrown100}`
    },
    secondary: {
      main: `${dfYellow75}`
    }
  },
  typography: {
    tab: {
      fontFamily: 'Raleway',
      textTransform: 'none',
      fontWeight: 700,
      fontSize: '1rem',
    },
    button: {
      fontFamily: 'Pacifico',
      fontSize: '1rem',
      textTransform: 'none',
      color: 'white',
    }
  }
})
